import React from "react";
import "../App.scss";
import "../css/Projects.scss";
import Grid from "@material-ui/core/Grid";

function Projects() {

  return (
    <div id="projects" className="padding-top-btm-4e">
      <div>
        <p className="menu-name">PROJECTS</p>
      </div>
      <Grid container spacing={2}>
        <Grid item xs={12} md={1}></Grid>
        <Grid item xs={12} md={5}>
          <div>
            <img src="/img/blogpage.png" alt="블로그페이지 이미지" className="projects-img"/>
          </div>
        </Grid>
        <Grid item xs={12} md={5}>
          <div>
            <p>블로그페이지</p>
            <p>풀스택으로 개발한 블로그 체험단 서비스입니다.</p>
            <div>
              <p>2017.11.01 - 2018.01.31(3개월)</p>
              <p>HTML5, CSS3, Bootstrap, Node.js, MYSQL</p>
            </div>
          </div>
        </Grid>
        <Grid item xs={12} md={1}></Grid>
      </Grid>

    </div>
  );
}

export default Projects;
